import React from 'react';
import './SignButton.css';
import { Link } from 'react-router-dom';
import { useNavigate } from "react-router-dom";

function eventHandler(){
    const history = useNavigate();
    history.push(`/Home`)
}


function SignButton(props) {

    return (
        props.withIcon ?
            <div className='SignButton' onClick={eventHandler()}>
                <img src = {props.icon}/>
                {props.message}
            </div>
            :
        props.signin!==1?
            <div className='SignButton-Email' onClick={eventHandler()}>
                {props.message}
            </div>
            :
            <div className='Signin-already' onClick={eventHandler()}>
                {props.message}
            </div>



    )
}

export default SignButton
